pragma solidity ^0.5.0;

import "openzeppelin-solidity/contracts/token/ERC721/ERC721.sol";
import "openzeppelin-solidity/contracts/ownership/Ownable.sol";
import "openzeppelin-solidity/contracts/token/ERC721/IERC721Metadata.sol";
import "openzeppelin-solidity/contracts/token/ERC721/ERC721Full.sol";

/**
 * @title MintableOwnableToken
 * @dev only owner can mint token.
 */
contract MintableOwnableToken is ERC721, IERC721Metadata, ERC721Full, Ownable {

    event CreateCollection(address indexed creator, string name, string symbol);

    event Mint(address indexed creator, uint256 indexed tokenId);

    constructor (address creator, string memory name, string memory symbol) public ERC721Full(name, symbol) {
        emit CreateCollection(creator, name, symbol);
    }

    /**
     * @dev Function to mint tokens.
     * @param creator Creator of the token
     * @param to The address that will receive the minted tokens.
     * @param tokenURI metadata
     * @return Token id
     */
    function mint(address creator, address to, string memory tokenURI) public onlyOwner returns (uint256) {
        uint256 tokenId = totalSupply();
        _mint(to, tokenId);
        _setTokenURI(tokenId, tokenURI);
        emit Mint(creator, tokenId);
        return tokenId;
    }

    function mint(address to, string memory tokenURI) public returns (uint256) {
        return mint(to, to, tokenURI);
    }

    function mint(string memory tokenURI) public returns (uint256) {
        return mint(msg.sender, msg.sender, tokenURI);
    }
}

